ption later on.", "app.settings.subscription.faq.3.header": "Does reputation stack?", "app.settings.subscription.faq.3.body": "No, reputation bonuses do not stack, only the highest reputation bonus will be taken into account.", "app.settings.subscription.faq.4.header": "What is \"Diamond level\"?", "app.settings.subscription.faq.4.body": "It's for long term supporters. For example, if you were to donate us, cumulatively, 120$, we should find a way to reward this generosity.{br}This is exactly why diamond level is here, so that if you do donate us 120$, you will be awarded with Level 4 diamond badge. (120/30){br}Also, a special gauge will display your level progress, if you donate less, let's say 10$.", "app.settings.account.title": "Settings | Account", "app.settings.account.links.header": "Linked accounts", "app.settings.account.links.remove": "Remove link", "app.settings.account.links.add": "Link account", "app.settings.account.links.info": "You can't delete the last account that is used to log into WFM.", "app.settings.account.credentials.create.header": "Create credentials", "app.settings.account.credentials.create.email": "Email", "app.settings.account.credentials.create.emailPlaceholder": "Your Email", "app.settings.account.credentials.create.password": "Password", "app.settings.account.credentials.create.passwordPlaceholder": "Your Password", "app.settings.account.credentials.create.confirmPassword": "Confirm password", "app.settings.account.credentials.create.confirmPasswordPlaceholder": "Your password", "app.settings.account.credentials.create.success": "Credentials added", "app.settings.account.credentials.create.submit": "Submit", "app.settings.account.credentials.change.header": "Change password", "app.settings.account.credentials.change.currentPassword": "Current password", "app.settings.account.credentials.change.currentPasswordPlaceholder": "Your current password", "app.settings.account.credentials.change.newPassword": "New password", "app.settings.account.credentials.change.newPasswordPlaceholder": "Your new password", "app.settings.account.credentials.change.confirmPassword": "Confirm password", "app.settings.account.credentials.change.confirmPasswordPlaceholder": "Confirm new password", "app.settings.account.credentials.change.success": "Password changed", "app.settings.account.email.change.header": "Change email", "app.settings.account.email.change.newEmail": "New email", "app.settings.account.email.change.newEmailPlaceholder": "Your new email", "app.settings.account.email.change.password": "Current password", "app.settings.account.email.change.passwordPlaceholder": "Your current password", "app.settings.account.email.change.success": "Email changed", "app.settings.account.credentials.change.submit": "Change", "app.settings.account.remove.header": "Account removal", "app.settings.account.remove.info": "Your account and all data will be deleted in a 7 days, including orders, auctions, reputation, chats, reviews, pretty much everything.{br}After that it will be impossible to restore your account.{br}If you want to continue, click the button to the right and confirm your request.", "app.settings.account.remove.confirm": "Are you sure you won't regret it in the future?", "app.settings.account.remove.removedIn": "You account will be removed {relativeTime}", "app.settings.account.remove.button.initiate": "Remove my account", "app.settings.account.remove.button.confirm.yes": "Yes, i am sure", "app.settings.account.remove.button.confirm.no": "Cancel", "app.settings.account.remove.button.cancel": "Cancel deletion process", "app.settings.notifications.title": "Settings | Notification", "app.settings.notifications.desktop.header": "Desktop Notifications", "app.settings.notifications.desktop.description": "Enable desktop notification feature.", "app.settings.notifications.desktop.test": "Test notification", "app.settings.notifications.desktop.blocking": "Your browser blocks notifications.", "app.settings.notifications.desktop.notSupporting": "This browser does not support desktop notification", "app.settings.notifications.push.header": "Push Notifications", "app.settings.notifications.push.description": "Enable push notification feature.{br}Enabling it will allow WFM to send you a notification, even if you close the tab with WFM on it. You cannot close the browser for it to work, however.", "app.settings.notifications.push.test": "Test push-notification", "app.settings.notifications.push.blocking": "Your browser blocks push-notifications.", "app.settings.notifications.push.notSupporting": "This browser does not support push-notifications.", "app.settings.notifications.howToEnable": "(How to enable)", "app.settings.automation.title": "Settings | Automation", "app.settings.automation.header": "Status Timer", "app.settings.automation.enableDescription": "Enable automatic status switch", "app.settings.automation.settingsDescription": "Automatically set my status to:", "app.settings.automation.invisible": "Invisible", "app.settings.automation.offline": "Offline", "app.settings.automation.hour": "{itemCount, plural, one {# hour} other {# hours}}", "app.settings.automation.after": "after", "app.settings.automation.since": "since the last status change.", "app.im.title": "Messages", "app.im.header": "Messages", "app.im.tabs.chats": "Chats", "app.im.tabs.ignoreList": "Ignore List", "app.im.chats.title": "Chats", "app.im.chats.noChats": "You don't have any chats, for now.", "app.im.chats.lastUpdate": "Last update", "app.im.chats.placeholder": "Your message", "app.im.chats.button.back": "Back", "app.im.chats.button.send": "Send", "app.im.chats.button.ignore": "Ignore user", "app.im.chats.button.leave": "Leave chat", "app.im.chats.button.more": "More", "app.im.chats.ignore_success": "Ignored", "app.im.chats.with.title": "Chat with {chatName}", "app.im.ignore.title": "Ignore list", "app.im.ignore.noEntries": "No one is ignored, for now.", "app.im.ignore.lastSeen": "Last seen:", "app.im.ignore.button.remove": "Remove", "app.im.ignore.empty": "Ignore list is empty", "app.auth.title": "Authorization | Warframe Market", "app.auth.header": "Authorization", "app.auth.signIn.title": "Sign In | Warframe Market", "app.auth.signIn.header": "Sign In", "app.auth.signIn.loginThrough": "Login through", "app.auth.signIn.loginWith": "Or Login with", "app.auth.signIn.email": "Email address", "app.auth.signIn.emailPlaceholder": "Your email", "app.auth.signIn.password": "Password", "app.auth.signIn.passwordPlaceholder": "Your password", "app.auth.signIn.button.signIn": "Sign in", "app.auth.signIn.link.forgot": "Forgot password?", "app.auth.signIn.link.register": "Or register", "app.auth.restore.title": "Restore password | Warframe Market", "app.auth.restore.header": "Restore password", "app.auth.restore.email": "Email address", "app.auth.restore.emailPlaceholder": "Your email", "app.auth.restore.success": "Email with instructions was sent.", "app.auth.restore.button.send": "Restore", "app.auth.register.title": "Registration | Warframe Market", "app.auth.register.header": "Registration", "app.auth.register.email": "Email address", "app.auth.register.emailPlaceholder": "Your email", "app.auth.register.password": "Password", "app.auth.register.passwordPlaceholder": "Your password", "app.auth.register.passwordConfirm": "Confirm Password", "app.auth.register.passwordConfirmPlaceholder": "Your password", "app.auth.register.joinNow": "Join now", "app.contacts.title": "Contact Us | Warframe Market", "app.contacts.header": "Contact Us", "app.contacts.socialNetworks": "In social networks", "app.contacts.socialNetworks.hint": "*Discord is preferable ;)", "app.contacts.email": "By email", "app.contacts.moderators": "Moderators", "app.contacts.QueenHathena": "QueenHathena", "app.contacts.IronHair": "IronHair", "app.contacts.MachetesAndSauce": "MachetesAndSauce", "app.contacts.KycKyc": "KycKyc", "app.contacts.Sui": "--TL--Sui", "app.contacts.Ionnstyle": "lonnstyle", "app.contacts.RoboSt3alth": "--Q--RoboSt3alth", "app.contacts.Faras": "--RV--Faras", "app.contacts.RNGesus21": "-IW-RNGesus21", "app.contacts.jackalope33": "--RV--Jackalope33", "app.contacts.milhail": "Milhail", "app.contacts.wisp": "--OTC--Wisp.VE", "app.contacts.QQmoderators": "QQ Moderators", "app.contacts.AKMnight": "AKMnight", "app.contacts.GanLin666": "GanLin666", "app.contacts.Nekojiru": "Nekojiru", "app.contacts.dorandkor": "DORANDKOR", "app.lookingFor.title": "Looking for | Warframe Market", "app.lookingFor.header": "Looking for", "app.tos.title": "Terms of Service | Warframe Market", "app.tos.header": "Terms of Service", "app.tos.note": "Note: ", "app.tos.trading": "Trading", "app.tos.trading.listings": "Listings", "app.tos.trading.listings.fakeOrders": "Fake orders are not allowed.", "app.tos.trading.listings.activityStatus": "Activity Status", "app.tos.trading.listings.activityStatus.onlineInGame": "\u201cOnline in game\u201d indicates you are in-game and ready to trade.{br}You have up to 15 minutes to complete the trading process.", "app.tos.trading.listings.activityStatus.online": "\u201cOnline\u201d means you might not be in-game or readily available to trade.{br}You have up to one hour to complete the trading process.", "app.tos.trading.listings.activityStatus.invisible": "\u201cInvisible\u201d means you are unable to respond to messages (such as being in a long mission), out of daily trades, or otherwise unavailable.{br}You are allowed to refuse your own listings while set to \u201cInvisible\u201d. You are, however, not allowed to refuse your listings if a trader has contacted you prior to you setting yourself to \u201cInvisible\u201d.", "app.tos.trading.listings.activityStatus.moderation": "The warframe.market moderation team may change your activity status irrespective of your current activity status.", "app.tos.trading.listings.activityStatus.doNotReply": "If you do not reply within the stated time frame (depends on status, see above), you can be suspended for 1-30 days, based on player reports or in case the warframe.market moderation team believes your listing is not genuine. This can lead to a permanent suspension in case of frequent infractions.{br}You can contact support on the warframe.market {discordLink} server for more details.", "app.tos.trading.listings.activityStatus.changeByWebsite": "The warframe.market website does not automatically change activity status on the website, based on your game state or logging in / out of warframe.", "app.tos.trading.listings.logIn": "If you don\u2019t log into warframe.market within 7 days, your listings are automatically deactivated.{br}Your listings will remain safe in your account, where you can activate them again by turning them \u201cvisible\u201d.", "app.tos.trading.listings.listingQuantities": "You are able to create up to 3 visible listings of the same item at different prices.", "app.tos.trading.listings.trashDucat": "Trash ducat items{br}This section refers to Ducat Trading, which is not fully supported on the website (yet).", "app.tos.trading.listings.trashDucat.primeParts": "Trash ducats refer to unvaulted prime parts from the current rotation. Refer to pin in #feedback-and-suggestions to-do list for discussions and added features to be added relating to buying trash ducats.", "app.tos.trading.listings.trashDucat.buyOrders": "In the interim, buy orders in bulk can be refused only in case the listed price is lower than other \u201conline in game\u201d buy orders or lower than trade chat rates of  6:12p.", "app.tos.trading.listings.trade": "You must be the person doing the trade. Creating listings for items that you do not have is not allowed.", "app.tos.trading.listings.noRequirement": "You cannot require users to buy, sell, or trade additional items or perform additional tasks prior to trading your listed item.", "app.tos.trading.listings.refusing": "Refusing your own offers is not allowed. You must honor the price of your listings as it appeared when you were contacted. The only exceptions are when your status is set to \u201cInvisible\u201d (see 1.2.3.) or obvious mistakes such as entering a high price and low quantity into the wrong fields. In the latter case you are expected to correct your listing within 5 minutes.", "app.tos.trading.listings.refusing.listingQuantities": "Listing quantity only indicates how many you are willing to buy or sell. You cannot refuse to buy or sell any amount at or lower than your listed quantity.", "app.tos.trading.process": "Trading Process", "app.tos.trading.process.definition": "The trading process is the time between the initial message of the \u201cContactor\u201d (which should be the standard warframe.market copy and paste message) and the trade fulfillment of the \u201cLister\u201d.{br}The trading process may have varied time limitations based on the \u201cLister's\u201d online status on the website.", "app.tos.trading.process.priceChanges": "Price Changes", "app.tos.trading.process.priceChanges.copyPaste": "Do not change the standard copy-paste message from warframe.market.{br}If you are interested in bartering with the other person, do so in a second message. Doing so may lead to leaving our terms of service and with that the ability to report users for any action they commit after doing so.", "app.tos.trading.process.changingPrice": "Changing prices or items during the full process, without informing the other party, is not allowed. You may not refuse your original offer listed on our website if the person you're trading with does not agree with the new change of price/items.", "app.tos.trading.process.ignoring": "Ignoring or refusing to communicate with either party without explanation may lead to an account suspension.", "app.tos.trading.reporting": "Reporting", "app.tos.trading.reporting.fakeListings": "In case of fake listings or inappropriate actions on warframe.market:", "app.tos.trading.reporting.fakeListings.tool": "You can report the user using the reputation tool on the website. Upload screenshots to an image hosting website (such as {imgur}) and include the URLs in the report.", "app.tos.trading.reporting.fakeListings.screenshot": "Please have complete chat screenshots with timestamps visible (which can be activated in game settings) along with any other relevant screenshots.", "app.tos.trading.reporting.fakeListings.discord": "You can contact a warframe.market moderator on the {discordLink} server.", "app.tos.trading.reporting.fakeListings.directLinks": "When reporting auctions, please include direct links to all targeted auctions.", "app.tos.trading.reporting.fakeListings.include": "Fake listings include, but aren\u2019t limited to, listings marked \u201conline in game\u201d but offline in game, afk listings, or \u201cjust sold\u201d but not removed from warframe.market (can take up to 5 mins to update on the site).", "app.tos.trading.reporting.inappropriateActions": "Inappropriate actions include, but aren\u2019t limited to, uncivil behavior and harassment via warframe.market inbox messages.", "app.tos.trading.reporting.fakeReport": "Fake / Malicious reports may result in suspension of your own account. Please provide screenshots / evidence to prove you're not randomly reporting others and help us on deciding our response.", "app.tos.trading.reporting.ownReport": "Do not submit a report on behalf of anyone else.", "app.tos.trading.contracts": "Contracts", "app.tos.trading.contracts.duplicates": "Duplicate contracts for the same item are not allowed.", "app.tos.trading.contracts.stats": "The rank and attribute values of a riven auction should match the rank and values of the riven as it appears in the mod screen, not the cycling or weapon modding screens. Attribute values should also match the values for the entered rank.", "app.tos.trading.contracts.fakeBids": "Making bids you do not intented to honor on auctions is not allowed and will lead to a permanent account suspension.", "app.tos.trading.contracts.auctionMade": "You may not use the auction process to start bidding wars, or to bait the seller of the item.", "app.tos.trading.contracts.valid": "Contract offers stay valid for 7 days, after which you have to renew your bid. You are allowed to refuse bids you have made that are older than 7 days.", "app.tos.trading.noteText": "We will not receive reports submitted using the in-game reporting system because we have no affiliation with Digital Extremes (as mentioned on the site disclaimer as well).{br}The warframe.market moderation team is unable to obtain any chat screenshots, chat or trading logs, either ingame or on site without you providing them.", "app.tos.trading.behavior": "Uncivil Behavior", "app.tos.trading.behavior.calling": "Calling the other user names is not allowed. Rude behavior is not allowed. Do not escalate, instigate or goad the other party into an argument.{br}In any such case, refer to the reporting section for how to report the other user.", "app.tos.trading.statistics": "Deceiving Statistics", "app.tos.trading.statistics.fakeOrders": "Attempts to deceive the statistics page data by closing fake orders (aka \u201csold\u201d Akbronco Prime for 10k platinum) will lead to a permanent account suspension.", "app.tos.trading.requirements": "Trading Requirements", "app.tos.trading.requirements.contacting": "Before contacting someone for a listed item, please check the trading requirements of the item + your own trading eligibility. You have to be:", "app.tos.trading.requirements.mr2": "MR2 or higher and have Two-Factor Authentication (2FA) activated on {warframeLink}, ", "app.tos.trading.requirements.2fa": "the appropriate Mastery Rank for the item, have enough trading tax for the item, and have enough tradable Platinum.", "app.tos.trading.requirements.masteryRank": "Note that starting / gifted / coupon Platinum is not tradable.", "app.tos.account": "Account", "app.tos.account.avatarsAndBack": "Avatars and Backgrounds", "app.tos.account.avatarsAndBack.notAllowed": "Obscene or indecent avatars and backgrounds are not allowed.", "app.tos.account.userName": "Username", "app.tos.account.userName.notExist": "Using a username that does not exist in the game is not allowed. The /profile chat command can be used to determine if a username exists or if the user has ever logged in.{br}If you have changed your in-game name, you must reverify yourself on warframe.market. Contact a warframe.market Moderator on {discordLink} or via the {contactUs} page in case you are having problems with this. {br}If your forum name has not updated after a name change, and you have tried logging out of the forums and logging in again, please contact DE\u2019s support: {deSupport}.", "app.tos.account.limitations": "Limitations", "app.tos.account.limitations.limitOrders": "There is a limit of 100 orders for free accounts, which can be extended by becoming a Patreon user. More details on {supportUs}.", "app.tos.account.banEvasion.title": "Suspension Evasion", "app.tos.account.banEvasion": "You must not attempt to evade account suspensions in any shape or form. Doing so will result in all relevant accounts permanently suspended.", "app.tos.api": "API", "app.tos.api.dataUsage": "Data usage", "app.tos.api.dataUsage.scrapingData": "Scraping data and using our API is allowed at a reasonable scale. {br}The limit is 3 requests per second.{br}You are not allowed to use our data for providing the same services. Please develop new features on top of that. (You are not limited to that for personal use/education purposes, but please contact us for permissions before public display of your product.){br}We reserve the right to block access for any app/service that attempts to use our data.", "app.tos.api.note.moreInfo": "For more information, join other third-party developers on our {discordLink} server.", "app.tos.pwaMobileApp": "PWA/Mobile App", "app.tos.pwaMobileApp.pwa": "PWA refers to Progressive Web Application, which is a mobile friendly way to access all the features of the website.{br}PWA is enabled for warframe.market. You can check pinned messages in our #android-ios-apps channel in the warframe.market {discordLink} server for how to add warframe.market PWA to your phone.{br}This will give you access to your notifications (Android devices only), all your listings and speedy access to the market on your mobile screen.", "app.tos.pwaMobileApp.mobile": "There is no official mobile app for warframe.market. Any payments made to any third-party application or ads shown on any app are not connected with warframe.market. The warframe.market moderation team does not provide support for any third-party apps.", "app.tos.disclaimer": "The moderation team reserves all the rights of final explanation.", "app.faq.title": "F.A.Q. | Warframe Market", "app.faq.header": "F.A.Q.", "app.faq.tableOfContents": "Table of contents", "app.faq.header.general": "General", "app.faq.header.trading": "Trading", "app.faq.header.account": "Account", "app.faq.de_disclaimer": "Is this site related to Digital Extremes?", "app.faq.de_disclaimer.description": "Nope, this site was made by 42bytes (independent devs).{br}We are not associated with Digital Extremes, and merely made this site to make trading easier.{br}Please do not contact DE\u2019s support with inquiries about this site. If you have questions/problems, contact us by mail.", "app.faq.contact_support": "How I can get in touch with your support?", "app.faq.contact_support.description": "Just write us a mail:{input}", "app.faq.how_to": "How to use this service?", "app.faq.how_to.description.1": "If you wish to look through some orders just use the search function on the home page and contact the buyer/seller.", "app.faq.how_to.description.2": "If you want to place an order, you must be registered on our site. We have 2 options:", "app.faq.how_to.description.2.steam": "Registration through Steam Login.", "app.faq.how_to.description.2.standalone": "Registration by our standalone system (See below).", "app.faq.how_to.description.3": "After registration and verification of your in-game name, you can place orders.", "app.faq.how_to.description.4.warn": "Don\u2019t forget to update your in-game online status - use the switcher on top right corner (menu)", "app.faq.how_to.description.5": "Other users will see your status, and if you\u2019re online they can contact you directly via an in-game Private Message.", "app.faq.verification_why": "Why do you need to verify my in-game name?", "app.faq.verification_why.description": "We don't want to see fake accounts and fake orders on our site.{br}It would create a bad experience for everyone.{br}We apologize if it means a few more minutes of setting up before you can trade, but this is a necessary procedure.", "app.faq.mail_usage": "How will you use my mail?", "app.faq.mail_usage.description": "Currently - only for login purposes.{br}You won\u2019t receive any messages from us. If we\u2019ll introduce some sort of email notifications in the future, we\u2019ll let you know in advance and provide an option to enable/disable the new features.", "app.faq.info_we_know": "What type of information will your service know about me?", "app.faq.info_we_know.description": "If you use our standalone login, we\u2019ll know your email.{br}You can use a fake email, it's your choice, and how we use your address is described above.{br}If you use Steam login, we\u2019ll know your steam name and steam id.", "app.faq.password_storage": "How do you store my password?", "app.faq.password_storage.description": "Your password isn\u2019t stored in our DB directly.{br}Instead, we store a HASH (by using {link}) generated on the basis of your password and some salt.{br}So no one \u2013 not even us \u2013 can get your password, don\u2019t worry.", "app.faq.change_my_name": "I changed my name in game, how can i change it here on site?", "app.faq.change_my_name.description": "You can re-verify your account, it will take your name from forum.{br}If forum still displays your old name, just relogin(on forum!).{br}If nothing helps, send us a mail with your old name and new one.", "app.faq.enable_notifications": "How to enable desktop notifications?", "app.faq.enable_notifications.description": "If your browser blocks notifications and you want to enable them, you can do so very easily.", "app.faq.enable_notifications.chrome.title": "For chrome browser:", "app.faq.enable_notifications.chrome.description": "1. On the top left corner of your browser, right before the address bar, click on the information icon -> {infoIcon}{br}2. Switch Notifications to `Allow`", "app.faq.enable_notifications.chrome.example": "Example:", "app.faq.enable_notifications.firefox.title": "For firefox browser:", "app.faq.enable_notifications.firefox.description": "1. On the top left corner of your browser, right before the address bar, click on the information icon -> {infoIcon}{br}2. Click `Preferences`{br}3. Click Notifications settings{br}4. Find warframe.market{br}5. Switch status to `Allow`", "app.privacy.title": "Privacy | Warframe Market", "app.privacy.header": "Privacy", "app.privacy.accessInfo.content": "You have the right to request that the company disclose certain information to you about our collection and use of your personal information over the past 12 months. Once we receive and confirm your verifiable consumer request (as described in the section \u201cExercising Access, Data Portability, and Deletion Rights\u201d), we will disclose to you:", "app.privacy.accessInfo.disclose.ourPurpose": "Our business or commercial purpose for collecting or selling that personal information.", "app.privacy.accessInfo.disclose.personalInfo": "The categories of personal information we collected about you.", "app.privacy.accessInfo.disclose.piecesInfo": "The specific pieces of personal information we collected about you (also called data portability request)", "app.privacy.accessInfo.disclose.soldInfo.disclosures": "Disclosures for a business purpose, identifying the personal information categories that each category of recipient obtained", "app.privacy.accessInfo.disclose.soldInfo.sales": "Sales, identifying the personal information categories that each category of recipient purchased", "app.privacy.accessInfo.disclose.soldInfo.title": "If we sold or disclose your personal information for a business purpose, two separate lists disclosing:", "app.privacy.accessInfo.disclose.sources": "The categories of sources for the personal information we collected about you.", "app.privacy.accessInfo.disclose.thirdParties": "The categories of third parties with whom we share that personal information.", "app.privacy.accessInfo.title": "Access to Specific Information and Data Portability Rights", "app.privacy.collectAndUse.advertising": "We may use third-party advertising companies to serve ads when you visit the Site. These companies may use aggregated information (not including your name, address, email address or telephone number) about your visits to this and other Web sites in order to provide advertisements about goods and services of interest to you. If you would like more information about this practice and to know your choices about not having this information used by these companies,", "app.privacy.collectAndUse.title": "Information Collection And Use", "app.privacy.collectAndUse.usingSite": "While using our Site, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you. Personally identifiable information may include, but is not limited to your name (\u201cPersonal Information\u201c).", "app.privacy.contactUs.questings": "If you have any questions about this Privacy Policy, please contact us.", "app.privacy.contactUs.title": "Contact Us", "app.privacy.cookies.title": "Cookies", "app.privacy.cookies.disable": "You can choose to disable or selectively turn off our cookies or third-party cookies in your browser settings, or by managing preferences in programs such as Norton Internet Security. However, this can greatly affect how you are able to interact with the Site as well as most other websites.", "app.privacy.cookies.storeInfo": "We use cookies to store information for your convenience (\u201cSettings\u201c). We also may use third party advertisements on the Site. Some of these advertisers may use technology such as cookies and web beacons when they advertise on the Site, which will also send these advertisers (such as Google through the Google AdSense program) information including your IP address, your ISP , the browser you used to visit our site, and in some cases, whether you have Flash installed. This is generally used for geotargeting purposes (showing New York real estate ads to someone in New York, for example) or showing certain ads based on specific sites visited (such as showing cooking ads to someone who frequents cooking sites).", "app.privacy.dataPortability.exercise": "To exercise the access, data portability, and deletion rights described above, please submit a verifiable consumer request to us by emailing us at", "app.privacy.dataPortability.registered": "Only you, or a person registered with the California Secretary of State that you authorize to act on your behalf, may make a verifiable consumer request related to your personal information. You may also make a verifiable consumer request on behalf of your minor child.", "app.privacy.dataPortability.respond": "We cannot respond to your request or provide you with personal information if we cannot verify your identity or authority to make the request and confirm the personal information relates to you.", "app.privacy.dataPortability.title": "Exercising Access, Data Portability, and Deletion Rights", "app.privacy.dataPortability.verifiableConsumer": "You may only make a verifiable consumer request for access of data portability twice within a 12-month period. The verifiable consumer request must:", "app.privacy.dataPortability.verifiableConsumer.detail": "De work activity.", "app.privacy.infoCollect.no": "No", "app.privacy.infoCollect.personalInfo": "B. Personal information categories listed in the California Customer Records statute (Cal. Civ. Code \u00a7 1798.80(e))", "app.privacy.infoCollect.profInfo": "I. Professional or employment-related information.", "app.privacy.infoCollect.protected": "C. Protected classification characteristics under California or federal law", "app.privacy.infoCollect.sensoryData": "H. Sensory data.", "app.privacy.infoCollect.title": "Information We Collect", "app.privacy.infoCollect.website": "Our websites, emails (with your consent, where required by law), and other products, services and platforms collect information that identifies, relates to, describes, references, is capable of being associated with, or could reasonably be linked, directly or indirectly, with a particular consumer or device (\u201cpersonal information\u201d). In particular, our websites, apps, emails, and other products, services and platforms may have collected the following categories of personal information from its consumers within the last twelve (12) months:", "app.privacy.infoCollect.yes": "Yes", "app.privacy.lastUpdate.42bytes": "42bytes (\u201cus\u201c, \u201cwe\u201c, or \u201cour\u201c) operates warframe.market (the \u201cSite\u201c). This page informs you of our policies regarding the collection, use and disclosure of Personal Information we receive from users of the Site.", "app.privacy.lastUpdate.title": "Last updated: February 1st, 2020", "app.privacy.lastUpdate.yourInfo": "We use your Personal Information only for providing and improving the Site. By using the Site, you agree to the collection and use of information in accordance with this policy.", "app.privacy.logData.browserInfo": "Like many site operators, we collect information that your browser sends whenever you visit our Site (\u201cLog Data\u201c).", "app.privacy.logData.info": "This Log Data may include information such as your computer's Int uding the Fair Credit Reporting Act(FRCA), the Gramm-Leach-Bliley Act (GLBA) or California Financial Information Privacy Act (FIPA), and the Driver\u2019s Privacy.", "app.privacy.notInclude.publicly": "Publicly available information from government records.", "app.privacy.personalInfo.additional": "The Company will not collect additional categories of personal information or use the personal information we collected formaterially different, unrelated, or incompatible purposes without providing you notice.", "app.privacy.personalInfo.disclore": "We may use or disclose the personal information we collect for one or more of the following business purposes:", "app.privacy.personalInfo.disclore.account": "To create, maintain, customize, and secure your account with us.", "app.privacy.personalInfo.disclore.enforcement": "To respond to law enforcement requests and as required by applicable law, court order, or governmental regulations.", "app.privacy.personalInfo.disclore.forth": "As described to you when collecting your personal information or as otherwise set forth in the CCPA.", "app.privacy.personalInfo.disclore.inquiries": "To provide you with support and to respond to your inquiries, including investigating and addressing your concerns and monitoring and improving our responses.", "app.privacy.personalInfo.disclore.merger": "To evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of the Company\u2019s assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which personal information held by the Company about our Website users is among the assets transferred.", "app.privacy.personalInfo.disclore.personalize": "To personalize your website, apps, emails, or other product, service or platform experience and to deliver content and product and service offerings relevant to your interests, including targeted offers and ads through our websites, apps, emails, and other products, services and platforms.", "app.privacy.personalInfo.disclore.process": "To process your requests, purchases, transactions, and payments and prevent transactional fraud.", "app.privacy.personalInfo.disclore.reason": "To fulfill or meet the reason you provided the information. For example, if you share your name and contact information to request a newsletter or ask a question about our products or services, we will use that personal information to respond to your inquiry. If you provide your personal information to purchase a product or service, we or our third-party service providers will use that information to process your payment and facilitate delivery. We may also save your information to facilitate new product or service orders and requests.", "app.privacy.personalInfo.disclore.security": "To help maintain the safety, security, and integrity of our websites, apps, emails, and other products, services and platforms, databases and other technology assets, and business.", "app.privacy.personalInfo.disclore.support": "To provide, support, personalize, and develop our websites, emails, and other products, services and platforms.", "app.privacy.personalInfo.disclore.testing": "For testing, research, analysis, and product development, including to develop and improve our websites, apps, emails, and other products, services and platforms.", "app.privacy.personalInfo.title": "Use of Personal Information", "app.privacy.policyChanges.title": "Changes To This Privacy Policy", "app.privacy.policyChanges.update": "We reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.", "app.privacy.residents.content": "This Privacy Notice for California Residents supplemen
